public void mapEntityToDataSource(DataEntityRuntimeContext _entityCtx, DataEntityDataSourceRuntimeContext _dataSourceCtx)
{
    super(_entityCtx, _dataSourceCtx);

    switch (_dataSourceCtx.name())
    {
        case dataEntityDataSourceStr(InventProductDefaultOrderSettingsEntity, InventDim):
            _dataSourceCtx.setBuffer(InventDim::findOrCreateBlank());
            break;
        case dataEntityDataSourceStr(InventProductDefaultOrderSettingsEntity, DefaultInventDim):
            _dataSourceCtx.setBuffer(this.getOrCreateDim(this.InventorySiteId, this.InventWarehouseId));
            break;
        case dataEntityDataSourceStr(InventProductDefaultOrderSettingsEntity, PurchDefaultInventDim):
            _dataSourceCtx.setBuffer(this.getOrCreateDim(this.ProcurementSiteId, this.ProcurementWarehouseId));
            break;
        case dataEntityDataSourceStr(InventProductDefaultOrderSettingsEntity, SalesDefaultInventDim):
            _dataSourceCtx.setBuffer(this.getOrCreateDim(this.SalesSiteId, this.SalesWarehouseId));
            break;
        case dataEntityDataSourceStr(InventProductDefaultOrderSettingsEntity, InventItemInventSetup):
            InventItemInventSetup inventSetup = _dataSourceCtx.getBuffer();

            if (_entityCtx.getDatabaseOperation() == DataEntityDatabaseOperation::Insert)
            {
                inventSetup.InventDimId = InventDim::findOrCreateBlank().inventDimId;
                inventSetup.ItemId = this.ItemNumber;
            }

            if (this.AreInventoryOrderPromisingDefaultsOverridden)
            {
                if (this.isFieldSet(fieldNum(InventProductDefaultOrderSettingsEntity, InventoryOrderPromisingMethod)))
                {
                    inventSetup.DeliveryDateControlType = this.InventoryOrderPromisingMethod;
                }
                if (this.isFieldSet(fieldNum(InventProductDefaultOrderSettingsEntity, InventoryATPDelayedDemandOffsetDays)))
                {
                    inventSetup.ATPApplyDemandTimeFence = this.InventoryATPDelayedDemandOffsetDays;
                }
                if (this.isFieldSet(fieldNum(InventProductDefaultOrderSettingsEntity, InventoryATPDelayedSupplyOffsetDays)))
                {
                    inventSetup.ATPApplySupplyTimeFence = this.InventoryATPDelayedSupplyOffsetDays;
                }
                if (this.isFieldSet(fieldNum(InventProductDefaultOrderSettingsEntity, InventoryATPBackwardDemandTimeFenceDays)))
                {
                    inventSetup.ATPBackwardDemandTimeFence = this.InventoryATPBackwardDemandTimeFenceDays;
                }
                if (this.isFieldSet(fieldNum(InventProductDefaultOrderSettingsEntity, InventoryATPBackwardSupplyTimeFenceDays)))
                {
                    inventSetup.ATPBackwardSupplyTimeFence = this.InventoryATPBackwardSupplyTimeFenceDays;
                }
                if (this.isFieldSet(fieldNum(InventProductDefaultOrderSettingsEntity, IsInventoryATPIncludingPlannedOrders)))
                {
                    inventSetup.ATPInclPlannedOrders = this.IsInventoryATPIncludingPlannedOrders;
                }
                if (this.isFieldSet(fieldNum(InventProductDefaultOrderSettingsEntity, InventoryATPTimeFenceDays)))
                {
                    inventSetup.ATPTimeFence = this.InventoryATPTimeFenceDays;
                }
            }
            break;
        case dataEntityDataSourceStr(InventProductDefaultOrderSettingsEntity, InventItemPurchSetup):
            if (_entityCtx.getDatabaseOperation() == DataEntityDatabaseOperation::Insert)
            {
                InventItemPurchSetup purchSetup = _dataSourceCtx.getBuffer();
                purchSetup.InventDimId = InventDim::findOrCreateBlank().inventDimId;
            }

            break;
        case dataEntityDataSourceStr(InventProductDefaultOrderSettingsEntity, InventItemSalesSetup):
            InventItemSalesSetup salesSetup = _dataSourceCtx.getBuffer();

            if (_entityCtx.getDatabaseOperation() == DataEntityDatabaseOperation::Insert)
            {
                salesSetup.InventDimId = InventDim::findOrCreateBlank().inventDimId;
                salesSetup.ItemId = this.ItemNumber;
            }

            if (this.AreSalesOrderPromisingDefaultsOverridden)
            {
                if (this.isFieldSet(fieldNum(InventProductDefaultOrderSettingsEntity, SalesOrderPromisingMethod)))
                {
                    salesSetup.DeliveryDateControlType = this.SalesOrderPromisingMethod;
                }
                if (this.isFieldSet(fieldNum(InventProductDefaultOrderSettingsEntity, SalesATPDelayedDemandOffsetDays)))
                {
                    salesSetup.ATPApplyDemandTimeFence = this.SalesATPDelayedDemandOffsetDays;
                }
                if (this.isFieldSet(fieldNum(InventProductDefaultOrderSettingsEntity, SalesATPDelayedSupplyOffsetDays)))
                {
                    salesSetup.ATPApplySupplyTimeFence = this.SalesATPDelayedSupplyOffsetDays;
                }
                if (this.isFieldSet(fieldNum(InventProductDefaultOrderSettingsEntity, SalesATPBackwardDemandTimeFenceDays)))
                {
                    salesSetup.ATPBackwardDemandTimeFence = this.SalesATPBackwardDemandTimeFenceDays;
                }
                if (this.isFieldSet(fieldNum(InventProductDefaultOrderSettingsEntity, SalesATPBackwardSupplyTimeFenceDays)))
                {
                    salesSetup.ATPBackwardSupplyTimeFence = this.SalesATPBackwardSupplyTimeFenceDays;
                }
                if (this.isFieldSet(fieldNum(InventProductDefaultOrderSettingsEntity, IsSalesATPIncludingPlannedOrders)))
                {
                    salesSetup.ATPInclPlannedOrders = this.IsSalesATPIncludingPlannedOrders;
                }
                if (this.isFieldSet(fieldNum(InventProductDefaultOrderSettingsEntity, SalesATPTimeFenceDays)))
                {
                    salesSetup.ATPTimeFence = this.SalesATPTimeFenceDays;
                }
            }

            if (this.IsSalesLeadTimeOverridden)
            {
                salesSetup.LeadTime = this.SalesLeadTimeDays;
            }
            break;
    }
}

public boolean insertEntityDataSource(DataEntityRuntimeContext _entityCtx, DataEntityDataSourceRuntimeContext _dataSourceCtx)
{
    if (this.mustSkipInsertEntityDataSource(_dataSourceCtx))
    {
        return true;
    }

    boolean ret = super(_entityCtx, _dataSourceCtx);
    return ret;
}

/// <summary>
/// Returns the default change tracking query.
/// </summary>
/// <returns>The default change tracking query.</returns>
public static Query defaultCTQuery()
{
    Query changeTrackingQuery = new Query();

    var inventItemInventSetupDS = changeTrackingQuery.addDataSource(tableNum(InventItemInventSetup));

    var inventItemPurchSetupDS  = inventItemInventSetupDS.addDataSource(tableNum(InventItemPurchSetup));
    var inventItemSalesSetupDS  = inventItemInventSetupDS.addDataSource(tableNum(InventItemSalesSetup));
    var salesParametersDS       = inventItemInventSetupDS.addDataSource(tableNum(SalesParameters));

    InventProductDefaultOrderSettingsEntity::setRelationsOfQueryBuildDataSource(inventItemPurchSetupDS, JoinMode::InnerJoin, QueryFetchMode::One2One, true);
    InventProductDefaultOrderSettingsEntity::setRelationsOfQueryBuildDataSource(inventItemSalesSetupDS, JoinMode::InnerJoin, QueryFetchMode::One2One, true);
    InventProductDefaultOrderSettingsEntity::setRelationsOfQueryBuildDataSource(salesParametersDS, JoinMode::OuterJoin, QueryFetchMode::One2One, true);
    salesParametersDS.addLink(fieldNum(InventItemInventSetup, DataAreaId), fieldNum(SalesParameters, DataAreaId));

    return changeTrackingQuery;
}

/// <summary>
/// Determines whether the insertion should be skipped for the given datasource or not.
/// </summary>
/// <param name = "_dataSourceCtx">
/// The <c>DataEntityDataSourceRuntimeContext</c> object.
/// </param>
/// <returns>
/// true, if it must skip the insertion of the given datasource; otherwise, false.
/// </returns>
protected boolean mustSkipInsertEntityDataSource(DataEntityDataSourceRuntimeContext _dataSourceCtx)
{
    switch (_dataSourceCtx.name())
    {
        case dataEntityDataSourceStr(InventProductDefaultOrderSettingsEntity, InventDim):
        case dataEntityDataSourceStr(InventProductDefaultOrderSettingsEntity, DefaultInventDim):
        case dataEntityDataSourceStr(InventProductDefaultOrderSettingsEntity, PurchDefaultInventDim):
        case dataEntityDataSourceStr(InventProductDefaultOrderSettingsEntity, SalesDefaultInventDim):
            // Read only datasource was handled by mapEntityToDataSource(...)
            return true;
    }
    return false;
}

private static void setRelationsOfQueryBuildDataSource(
                                                QueryBuildDataSource _qbds, 
                                                JoinMode _joinMode, 
                                                QueryFetchmode _queryFetchMode, 
                                                boolean _relations)
{
    _qbds.joinMode(_joinMode);
    _qbds.fetchMode(_queryFetchMode);
    _qbds.relations(_relations);
}

private InventDim getOrCreateDim(InventSiteId _siteId, InventLocationId _warehouseId)
{
    InventDim inventDim;
    inventDim.InventSiteId = _siteId;
    inventDim.InventLocationId = _warehouseId;

    this.validateInventoryDimensions(inventDim);

    inventDim = InventDim::findOrCreate(inventDim);
    return inventDim;
}

private void validateInventoryDimensions(InventDim _inventDim)
{
    Set allowEmptyFields = new Set(Types::Integer);
    allowEmptyFields.add(-1);
    if (!_inventDim.checkDimFieldsValid(this.ItemNumber, InventDim::findOrCreateBlank(), true, allowEmptyFields, true))
    {
        throw error("@SYS304643");
    }
}

